import React from 'react';
import '../styles/leagues.css';


function Leagues() {


   // Create an array of objects for sample data
let data = [
    { id: 1, name: 'John Doe', age: 30, city: 'New York' },
    { id: 2, name: 'Jane Smith', age: 25, city: 'San Francisco' },
    { id: 3, name: 'Mike Johnson', age: 35, city: 'Chicago' }
  ];

  // Function to generate the table
  function generateTable(tableData) {
    let table = document.createElement('table');
    let thead = document.createElement('thead');
    let tbody = document.createElement('tbody');

    // Table header
    let headers = Object.keys(tableData[0]);
    let headerRow = document.createElement('tr');
    headers.forEach(headerText => {
      let th = document.createElement('th');
      let textNode = document.createTextNode(headerText);
      th.appendChild(textNode);
      headerRow.appendChild(th);
    });
    thead.appendChild(headerRow);
    table.appendChild(thead);

    // Table body
    tableData.forEach(rowData => {
      let row = document.createElement('tr');
      Object.values(rowData).forEach(value => {
        let cell = document.createElement('td');
        let textNode = document.createTextNode(value);
        cell.appendChild(textNode);
        row.appendChild(cell);
      });
      tbody.appendChild(row);
    });
    table.appendChild(tbody);

    return table;
  }

  // Get a reference to the div where you want to add the table
  let tableContainer = document.getElementById('table-container');

  // Generate the table and add it to the container
  let generatedTable = generateTable(data);
  tableContainer.appendChild(generatedTable);

}

export default Leagues;
